import React from "react";


function Daily(){
    return (
        <div>
        <div className="DailyDate">
        <p1 className="WeatherIcon">Thu 21</p1>
        </div>
        <br></br>
        <img src="http://openweathermap.org/img/wn/10d@2x.png"></img>

        </div>
    );


}
export default Daily;
